          "description": "Señal en directo desde el exterior de Balmoral, donde la reina Isabel II de Inglaterra se encuentra bajo supervisión médica. La reina Isabel II de Inglaterra, que el pasado 21 de abril cumplió 96 años, está bajo vigilancia médica en el castillo de Balmoral (Escocia) después de que, tras un examen médico este jueves, los médicos hayan expresado su “preocupación por la salud de Su Majestad”, según ha informado Buckingham en una nota. Carlos de Inglaterra y su esposa, Camila de Cornualles, ya están con ella. También sus otros tres hijos —Andrés, Ana y Eduardo— y el príncipe Guillermo, nieto de Isabel II y segundo en la línea de sucesión al trono. Enrique de Inglaterra y su mujer, Megan Markle, están de camino. El comunicado ha desatado la alarma en el Reino Unido. Isabel II permanece en su residencia de verano desde hace meses y allí recibió el martes al primer ministro saliente del Reino Unido, Boris Johnson, y a la nueva primera ministra, Liz Truss, para encargarle la formación de un Gobierno. Desde entonces, sin embargo, se ha sabido que la monarca ha cancelado su reunión semanal con el Consejo Privado, el grupo de notables con el que discute cada semana —normalmente, por videoconferencia— asuntos de Estado. Liz Truss ha publicado un mensaje de apoyo a la familia.\n\nSuscríbete a nuestro canal: http://cort.as/yI0n\r\nVisita http://elpais.com\r\nMás vídeos de EL PAÍS: http://cort.as/YGC9\r\nSíguenos en Facebook: https://www.facebook.com/elpais\r\nTwitter: https://twitter.com/el_pais\r\nInstagram: https://www.instagram.com/el_pais\n\r\n#Isabel #IsabelII #ReinoUnido #Reina #ReinaInglaterra #familiareal"
